import { Avatar } from "@mui/material"


const CardItem = ({ title, img, link }) => {

    return (
        <div className="items-movies">
            <Avatar sx={{ width: 56, height: 56 }} className="movies-img" src={img} />
            <p>{title}</p>
            <a href={link}></a>
        </div>
    )

}

export default CardItem
